import React from 'react'
import { connect } from 'react-redux'

function imageGrid() {
    return (
        <div>
            <h>Dispatch Action</h>
        </div>
    )
}

const mapDispatchToProps = dispatch => ({
    loadImages: () => dispatch(loadImages())
})

export default connect(null, mapDispatchToProps)(imageGrid)
